// Simple Variables
int aHanzi[256]; // 19968 - 4e00

/* Init the HW layer */
void ct_hwhanzi_init() 
{
   int i;
   for (i = 0; i < 255; i++)
   	aHanzi[i] = 0;
}

/* Gets if a bit is 1) */
int hwhanzi_bitOne(u8 num, u8 pos)
{
   return ((num >> pos) & 1);
}

/* Gets a pointer to a certain sprite of a hanzi - 256 bytes 0(White) 1(Black) */
void* ct_hwhanzi_getHanzi(u16 hanzi) 
{
   int i;
   int hanziVal = hanzi - 19968; // 4e00
   for (i = 0; i < 255; i++) {
      aHanzi[i] = hwhanzi_bitOne(gfx_hanzi[hanziVal][i / 8],i % 8);
	}   
   return &aHanzi;
}

/* Gets a pointer to a certain sprite of a separator - 256 bytes 0(White) 1(Black) */
void* ct_hwhanzi_getHanziSep(char sep) 
{
   int i;
   int hanzival = 0;
   switch (sep) {
      case '.':
         hanzival = 0;
         break;
      case ',':
         hanzival = 1;
         break;
      case '?':
         hanzival = 2;
         break;
      case '!':
         hanzival = 3;
         break;         
      case 'X':
         hanzival = 4;
         break;         
   }   
   for (i = 0; i < 255; i++) {
      aHanzi[i] = hwhanzi_bitOne(gfx_sep[hanzival][i / 8],i % 8);
	}   
   return &aHanzi;
}

int ct_hwhanzi_empty(u16 hanzi) 
{
   int i;
   int val = 0;
   int hanziVal = hanzi - 19968; // 4e00
   for (i = 0; i < 255; i++) {
      if (hwhanzi_bitOne(gfx_hanzi[hanziVal][i / 8],i % 8))
      	val += 1;
	}
	if (val == 255)
		return 1;
	else return 0;
}   

